import React from 'react';
import Nav from 'react-bootstrap/Nav'


function Classes() {
  return (
    <div className="Classes">
      <Nav justify variant="tabs" defaultActiveKey="degreePlan">
        <Nav.Item>
          <Nav.Link eventKey="degreePlan" href="">Degree Plan</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="coursesTaken" href="">Courses Taken </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="coursesNotTaken" href="">Courses Not Taken</Nav.Link>
        </Nav.Item>
      </Nav>
      <img href="Flowchart.jpg" alt=""></img>
    </div>
  );
}

export default Classes;
